            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origin of the program   </h3>
                <p class=""description""> 
                    In order to meet the growing needs of companies in IT solutions integration; the IT, networks & telecom program provided by BIIM, within the
                    framework of the International Education framework is an education aimed at preparing students in three academic years for the functions of
                    engineers while offering them the opportunity to continue their studies according to their personal project and professional development in the
