                    <li> Integrate service companies and network equipment manufacturers, </li>
                    <li> Work with telecommunications operators and Internet access providers, </li>
                    <li> Integrate companies and administrations managing their own information and communication systems, </li>
                    <li> To work in IT services and engineering companies, </li>
                    <li> Execute IT operations, backups/Restorations in companies, </li>
                    <li> Frame and implement local IT projects for businesses, </li>
                    <li> Develop studies for setting up a SharePoint Server 2010 collaboration environment, </li>
